import "./CrossChain/ContractBase.sol";

import "./Starport.sol";
import "./interfaces/IStarDiamond.sol";
import "./interfaces/IStarshipFactory.sol";
import "./library/Bytes.sol";

/**
 * @title The main star port
 * @dev The star port which can deal with star diamond and create new starships
 */
contract MainStarport is Starport, IStarDiamond, IStarshipFactory {
    struct StarportId {
        string galaxy;
        address starportId;
    }

    // Balances of star diamonds
    mapping (address => uint256) private _starDiamondBalances;

    // The newest starship id
    uint256 public currentShipId;

    // diamonds needed to create ship
    uint256 public diamonds4Ship;

    // Starports in the allience
    StarportId[] private _starports;

    constructor() {
        diamonds4Ship = 8848;
    }

    // test only
    function diamondFaucet() public {
        _starDiamondBalances[msg.sender] = diamonds4Ship;
    }

    /**
     * @notice See {IStarDiamond-synthesizeDiamond}
     */
    function synthesizeDiamond(uint shipId, uint amount) public override {
        require(_starshipNFTContract.ownerOf(shipId) == msg.sender, "Not owner of the ship");
        StarshipRecord storage ship = _dockedShips[shipId];
        // To be continued, the assert will never be triggered
        require(ship.used, "Not docked");

        uint withdrawAmount = 0;
        for (uint i = 0; i < _starports.length; i++) {
            uint shardAmount = 0;
            for (uint j = 0; j < ship.shipInfo.diamondShards.length; j++) {
                if (ship.shipInfo.diamondShards[j].starportId == _starports[i].starportId &&
                keccak256(bytes(ship.shipInfo.diamondShards[j].galaxy)) == keccak256(bytes(_starports[i].galaxy))) {
                    shardAmount = ship.shipInfo.diamondShards[j].amount;
                    break;
                }
            }

            if (i == 0) {
                withdrawAmount = shardAmount;
            }
            else {
                if (withdrawAmount > shardAmount) {
                    withdrawAmount = shardAmount;
                }
            }
        }

        if (withdrawAmount > amount) {
            withdrawAmount = amount;
        }

        for (uint256 i = 0; i < ship.shipInfo.diamondShards.length; ++i) {
            ship.shipInfo.diamondShards[i].amount -= withdrawAmount;
        }

        _starDiamondBalances[msg.sender] += withdrawAmount;
    }

    /**
     * @notice See {IStarDiamond-diamondBalanceOf}
     */
    function diamondBalanceOf(address account) public override view returns (uint) {
        return _starDiamondBalances[account];
    }

    /**
     * @notice See {IStarshipFactory-createStarship}
     */
    function createStarship(address _to, uint16 _type) public override {
        require(_starDiamondBalances[msg.sender] >= diamonds4Ship, "Not enough diamonds");

        _starDiamondBalances[msg.sender] -= diamonds4Ship;

        uint shipId = currentShipId++;
        _starshipNFTContract.shipArrive(_to, shipId);

        StarshipRecord storage newShip = _dockedShips[shipId];
        newShip.shipInfo.shipId = shipId;
        newShip.shipInfo.shipType = _type;
        newShip.shipInfo.shipLevel = 1;
        newShip.startBlock = block.number;
        newShip.used = true;
    }

    /**
     * @notice Set the starports information in the allience
     */
    function setStarports(StarportId[] calldata _ports) public onlyOwner {
        for (uint i = 0; i < _ports.length; i++) {
            // Check repetition
            for (uint j = i + 1; j < _ports.length; j++) {
                bytes32 hash = keccak256(abi.encode(_ports[i]));
                require(hash != keccak256(abi.encode(_ports[j])), "StarportId duplicated");
            }
            if (_starports.length < i + 1) {
                _starports.push(_ports[i]);
            }
            else {
                _starports[i] = _ports[i];
            }
        }

        for (uint i = _ports.length; i < _starports.length; i++) {
            _starports.pop();
        }
    }

    /**
     * @notice Returns starports information in the allience
     */
    function starports() public view returns (StarportId[] memory) {
        return _starports;
    }
}
